    form {
      background: rgba(255, 255, 255, 0.9);
      padding: 20px;
      max-width: 500px;
      margin: 80px auto;
      border-radius: 10px;
      box-shadow: 0 4px 10px rgba(0, 0, 0, 0.2);
    }

    h1 {
      text-align: center;
    }

    input, textarea, select, button {
      width: 100%;
      padding: 10px;
      margin-top: 10px;
      font-size: 1rem;
      border: 1px solid #ccc;
      border-radius: 4px;
    }

    button {
      background-color: #4CAF50;
      color: white;
      font-weight: bold;
      cursor: pointer;
    }

    button:hover {
      background-color: #45a049;
    }

    #thank-you {
      text-align: center;
      color: green;
      font-weight: bold;
      display: none;
      margin-top: 20px;
    }

    #language-buttons {
      text-align: center;
      margin-top: 20px;
    }
  </style>
</head>
<body>

  <div class="background"></div>

  <div id="language-buttons">
    <button onclick="switchLanguage('en')">English</button>
    <button onclick="switchLanguage('my')">မြန်မာ</button>
  </div>

  <form id="jobForm" action="/submit" method="POST" enctype="multipart/form-data">
    <h1 id="form-title">Job Application Form</h1>
    <input type="text" name="name" id="name" placeholder="Name" required />
    <input type="tel" name="phone" id="phone" placeholder="Phone Number" required />
    <textarea name="motivation" id="motivation" rows="4" placeholder="Motivation" required></textarea>
    <select name="experience" id="experience" required>
      <option value="">Select Experience</option>
      <option value="yes">Yes</option>
      <option value="no">No</option>
    </select>
    <input type="file" name="resume" id="resume" accept=".pdf,.doc,.docx" required />
    <button type="submit" id="submit-button">Submit</button>
  </form>

  <div id="thank-you">Thank you for your application!</div>

  <script>
    const translations = {
      en: {
        title: "Job Application Form",
        name: "Name",
        phone: "Phone Number",
        motivation: "Motivation",
        experienceLabel: "Experience in Garment Industry",
        optionSelect: "Select Experience",
        optionYes: "Yes",
        optionNo: "No",
        resume: "Attach Resume",
        submit: "Submit",
        thank: "Thank you for your application!"
      },
      my: {
        title: "အလုပ်လျှောက်လွှာ",
        name: "အမည်",
        phone: "ဖုန်းနံပါတ်",
        motivation: "လျှောက်လွှာပေးသည့်အကြောင်းအရင်း",
        experienceLabel: "အထည်အလိပ်လုပ်ငန်း အတွေ့အကြုံ",
        optionSelect: "အတွေ့အကြုံရွေးချယ်ပါ",
        optionYes: "ရှိသည်",
        optionNo: "မရှိပါ",
        resume: "CV တင်ပါ",
        submit: "တင်ပြမည်",
        thank: "လျှောက်လွှာပေးသည့်အတွက် ကျေးဇူးတင်ပါသည်။"
      }
    };

    function switchLanguage(lang) {
      document.getElementById("form-title").innerText = translations[lang].title;
      document.getElementById("name").placeholder = translations[lang].name;
      document.getElementById("phone").placeholder = translations[lang].phone;
      document.getElementById("motivation").placeholder = translations[lang].motivation;
      document.getElementById("experience").options[0].text = translations[lang].optionSelect;
      document.getElementById("experience").options[1].text = translations[lang].optionYes;
      document.getElementById("experience").options[2].text = translations[lang].optionNo;
      document.getElementById("submit-button").innerText = translations[lang].submit;
      document.getElementById("thank-you").innerText = translations[lang].thank;
    }

    const form = document.getElementById('jobForm');
    const thankYou = document.getElementById('thank-you');
    form.addEventListener('submit', function(e) {
      e.preventDefault();
      const formData = new FormData(form);
      fetch('/submit', {
        method: 'POST',
        body: formData
      }).then(response => {
        if (response.ok) {
          form.style.display = 'none';
          thankYou.style.display = 'block';
        } else {
          alert("Submission failed.");
        }
      });
    });
  </script>

</body>
</html>
